sourcesContent:
import express from "express";
import { selectSql } from "../database/sql";

const router = express.Router();

router.get('/', (req, res) => {
    res.render('home');
});

router.post('/', async (req, res) => {
    const vars = req.body;
    const students = await selectSql.getStudent();
    
    req.session.student = undefined;

    students.map((student) => {
        console.log('ID :', student.Id);
        if (vars.id === String(student.Id) && vars.password === student.Phone_number) {
            console.log('login success!');
            req.session.student = { id: student.Id, role: 'student', checkLogin: true };
        }
    });

    if (req.session.student == undefined) {
        console.log('login failed!');
        res.send(`<script>
                    alert('login failed!');
                    location.href='/';
                </script>`)
    }
    // else if (req.session.student.checkLogin && req.session.student.role === 'super') {
    //     res.redirect('/delete');
    // }
    else if (req.session.student.checkLogin && req.session.student.role === 'student') {
        res.redirect('/select');
    }
});

module.exports = router;

