sourcesContent:
import express from 'express';
import { selectSql, deleteSql } from '../database/sql';

const router = express.Router();

router.get('/class', async (req, res) => {
    if (req.session.user != undefined && req.session.user.role === 'student') {
        const enrollment = await selectSql.getMyEnrollment(String(req.session.user.id));
        res.render('delete', {
            title: "Delete",
            enrollment,
        });
    } else{
        res.redirect('/');
    }
});

router.post('/class', async (req, res) => {
    console.log("delete :", req.body.delBtn);
    const data = {
        Id: req.body.delBtn,
    };

    await deleteSql.deleteClass(data);

    res.redirect('/delete');
});

module.exports = router;

